import React from "react";

import "./listGroup.scss";

const ListGroup = ({ currentTab }) => {
  return (
    <ul className="list-group">
      <li
        className={
          currentTab === "home" ? "list-group-item active" : "list-group-item"
        }
      >
        Home
      </li>
      <li className="list-group-item">Libor</li>
      <li className="list-group-item">Email Wizards</li>
      <li className="list-group-item">Rules Extraction</li>
      <li className="list-group-item">Document Digitization</li>
    </ul>
  );
};

export default ListGroup;
